import React from "react";
import PageHeader from "../Components/common/PageHeader";
import Quarries from "../Components/quarries/Quarries";

function QuarriesPage() {
  return (
    <>
      <PageHeader title="Ocaklarımız" />

      <Quarries />
    </>
  );
}

export default QuarriesPage;
